import React from 'react';
import "./Card.css";


const Card = props => (

    <div
    className="allCards"
    style={{backgroundImage:`url(${props.src})`}}
    alt={props.alt}
    className="block"
    onClick={() => props.handleClick(props.name)}>
</div>
)


export default Card
